import React from 'react';
import './NavBar.css';
import { FaGlobe, FaSearch, FaBars } from 'react-icons/fa'; // Importing icons from react-icons

const NavBar = () => {
    return (
        <nav className="navbar">
            <div className="nav-container">
                {/* Left: Globe Icon */}
                <a href="/new-page" className="nav-logo">
                    <FaGlobe className="icon" /> {/* Globe icon */}
                </a>

                {/* Middle: Search Icon */}
                <div className="nav-search">
                    <FaSearch className="icon" /> {/* Search icon */}
                </div>

                {/* Right: Menu Icon */}
                <div className="nav-menu">
                    <FaBars className="icon" /> {/* Menu icon */}
                </div>
            </div>
        </nav>
    );
};

export default NavBar;
